Dzień dobrym, mam do sprzedania samochód osobowy marki Volvo V70 wyprodukowany w 2001 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1870 cm3, legitymujący się mocą 115 KM, który pokonał do tej pory 254000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, ale sprzegło zbliza sie do wymiany, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Volvo prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane, komfortu dodaje sprawna chłodząca klimatyzacja.



V40 jest wyposażenia w:

- Klimatyzację;

- Podgrzewane przednie siedzenia;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie;

- Elektryczne lusterka;

- 4 x airbag;

